# ------- Question 2 Helpers -------

from cryptography.fernet import Fernet

# Enum for the gate type
XOR_GATE = 0
AND_GATE = 1
OR_GATE = 2

class GarbledCiphertexts(object):
    def __init__(self, xor_ciphertexts, and_ciphertexts, or_ciphertexts):
        self.XOR_ciphertexts = xor_ciphertexts
        self.AND_ciphertexts = and_ciphertexts
        self.OR_ciphertexts = or_ciphertexts

class OT_Protocol(object):
    def __init__(self, xor_1st_input_label_mapping, and_1st_input_label_mapping):
        self.xor_1st_input_label_mapping = xor_1st_input_label_mapping
        self.and_1st_input_label_mapping = and_1st_input_label_mapping
        self.xor_first_time = True
        self.and_first_time = True
    
    def OT(self, input_gate_type, input):
        if (input not in [0, 1]):
            raise ValueError("Invalid input value, make sure its an int that's either `0` or `1`")
        
        if (input_gate_type == XOR_GATE):
            assert(self.xor_first_time)
            self.xor_first_time = False
            return self.xor_1st_input_label_mapping[input]
        
        elif (input_gate_type == AND_GATE):
            assert(self.and_first_time)
            self.and_first_time = False
            return self.and_1st_input_label_mapping[input]
        else:
            raise ValueError("Invalid input gate type")

def authenticated_decryption(key, ciphertext):
    key = bytes.fromhex(key)
    f = Fernet(key)
    token = bytes.fromhex(ciphertext)
    return f.decrypt(token).hex()

def doubly_authenticated_decryption(key1, key2, ciphertext):
    return authenticated_decryption(key2, authenticated_decryption(key1, ciphertext))

